import { fetchData } from 'Helper/utils';
import VendingMachine from 'Pages/VendingMachine';
import { useEffect, useState } from 'react';

const useFetch = (url) => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const getData = async () => {
      const data = await fetchData(url);
      setData(data);
    };
    getData();
  }, []);
  return [data, setData];
};

const WALLET_API = `http://localhost:3001/money/0`;
const INVESTMENT_API = `http://localhost:3001/money/1`;
function App() {
  const [walletMoney, setWalletMoney] = useFetch(WALLET_API);
  const [investment, setInvestment] = useFetch(INVESTMENT_API);
